class App extends Component {
    render() {
        return (
            <div>
                <div className='text-center' style={{
                    color: 'green',
                    fron
                }}>
                    <p>Hello, World!</p>
                </div>
                <div>
                    hello
                </div>
            </div>
        )
    }
}

export default App;
